//get called if somebody connects via socket.io to our ip
io.on('connection', function (socket) {
	//sharing images between all clients
	//if a new images comes in, every client gets the new image broadcasted 
	socket.on('new_image', function (data) {
		pictures.createPicture(data.imageData, data.transmitternumber, [], []);
		console.log('A imagefile was transmitted with collageorder: ' + data.collageorder);
		socket.broadcast.emit('incoming_image', data);
	});
	socket.on('new_user', function (number, token) {
		console.log("a new user registered: " + number + " token: " + token);
		//createing a new gcm message
		var registrationTokens = [];
		registrationTokens.push('token');
		var message = new gcm.Message({
			collapseKey: 'demo',
			priority: 'high',
			contentAvailable: true,
			delayWhileIdle: true,
			timeToLive: 3,
			restrictedPackageName: "somePackageName",
			dryRun: true,
			data: {
				key1: 'message1',
				key2: 'message2'
			},
			notification: {
				title: "Hello, World",
				icon: "ic_launcher",
				body: "This is a notification that will be displayed ASAP."
			}
		});
		//retrying to send the gcm message a specific number of times (10) 
		sender.send(message, { registrationTokens: registrationTokens }, 10, function (err, response) {
			if (err) console.error(err);
			else console.log(response);
		});
		//end of gcm message
	});
	//users.createUser(number, number, "noImage");

	// query db for all todo item
	//refresh
	socket.on('user_refresh', function (user_number, update_trigger) {
		console.log("user requested a refresh: " + user_number + " the trigger was: " + update_trigger);
		//console.log("this is in the db: "+pictures.getPictures());
		//socket.emit('updateUserData', pictures.getPictures());
		socket.emit('updateUserData', votes.getVotes());
		var image = {
			"imageData": "",
			"timestamp": Date.parse(Date()), "transmitternumber": "Server", "single": "yes"
		};
		//socket.emit('incoming_image', image);
		var collageimage1 = {
			"imageData": "",
			"timestamp": Date.parse(Date()), "transmitternumber": "Server", "collageorder": "1"
		};
		var collageimage2 = {
			"imageData": "",
			"timestamp": Date.parse(Date()), "transmitternumber": "Server", "collageorder": "2"
		};
		var collageimage3 = {
			"imageData": "",
			"timestamp": Date.parse(Date()), "transmitternumber": "Server", "collageorder": "3"
		};
		var collageimage4 = {
			"imageData": "",
			"timestamp": Date.parse(Date()), "transmitternumber": "Server", "collageorder": "4"
		};
		collage = [];
		collage.isCollage = true;
		collage.push(collageimage1);
		collage.push(collageimage2);
		collage.push(collageimage3);
		collage.push(collageimage4);
		//console.log("sending: " + collage);
		socket.emit('incoming_image', collage);
	});

	//transfareing vote
	socket.on('vote', function (data) {
		//console.log(data);
		votes.createVote(data.imageData, data.number, data.rating);
		console.log('a voting was transmitted from: ' + data.number + 'with vote: ' + data.rating);
		io.emit('vote_sent_from_server', data);
	});


	//showing when somebody opens socket.io connection or closes 
	console.log('A new connection is now open');
	socket.on('disconnect', function () {
		console.log('A connection was closed');
	});
});


